-- Lua functions
local tinsert = table.insert
local unpack = unpack

-- Global environment
local _G = _G

-- AddOn namespace
local _, Private = ...

-- ElvUI modules
local E, L = unpack(ElvUI)

--[[
Plater profile
LC: 21/09/2025
]]

function Private:Setup_Plater(installer)
  if not E:IsAddOnEnabled("Plater") then
    Private:Print("Plater " .. "is not installed or enabled.")
    return
  end

  -- Profile name
  local name = (E.global.XVUI.dev and "XvUI") or "XvUI " .. Private.Version

  -- Profile string
  local profileString =
    "!PLATER:2!"

    local data = Plater.DecompressData(profileString, "print")

  -- Profile import
  if _G.PlaterDB.profiles[name] then
    tinsert(_G.PlaterDB.profileKeys, E.mynameRealm)
    _G.PlaterDB.profileKeys[E.mynameRealm] = name
  else
    _G.PlaterDB.profiles[name] = data
    _G.PlaterDB.profileKeys[E.mynameRealm] = name
  end

  if installer then
    PluginInstallStepComplete.message = "Plater profile has been set."
    PluginInstallStepComplete:Show()
  end

  Private:Print("Plater profile has been set.")
end
